import { Box, Modal } from '@material-ui/core';

export const PopUpResendCode = (props: {
    open: boolean,
    handleClose: () => void,
    phone: number
}) => {
    return (
        <Modal
            open={props.open}
            onClose={props.handleClose}
        >
            <Box>
                <p>A code has been sent to {props.phone} via SMS</p>
            </Box>
        </Modal>
    )
}
